    World War II

 ( often abbreviated to WWII or WW2 ) , also known as the Second World War , was a global war that lasted from 1939 to 1945 , although related conflicts began earlier . It involved the vast majority of the world's nationsincluding all of the great powerseventually forming two opposing military alliances : the Allies and the Axis . It was the most widespread war in history , and directly involved more than 100 million people from over 30 countries . In a state of &quot; total war &quot; , the major participants threw their entire economic , industrial , and scientific capabilities behind the war effort , erasing the distinction between civilian and military resources . Marked by mass deaths of civilians , including the Holocaust ( in which approximately 11 million people were killed ) and the strategic bombing of industrial and population centres ( in which approximately one million were killed , and which included the atomic bombings of Hiroshima and Nagasaki ) , it resulted in an estimated 50 million to 85 million fatalities . These made

<h2 style="margin: 0">1</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">The War Shipping Administration ( WSA ) was a 
<mark class="entity" style="background: linear-gradient(90deg, #388e3c, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 emergency war agency of the US government , tasked to purchase and operate the civilian shipping tonnage the US needed for fighting the war . Both shipbuilding under the Maritime Commission and ship allocation under the WSA to Army , Navy or civilian needs were closely coordinated though Vice Admiral Emory S . Land who continued as head of the Maritime Commission while also heading the WSA .</div>
